import { Link, useParams } from "react-router-dom";


const EventDetailPage = () => {
  const params = useParams()

  return (
    <>
      <h1>Event Detail Page</h1>
      <p>{params.eventId}</p>
      <Link to="/events">Back to Events</Link>
    </>
  )
}

export default EventDetailPage
